function WeatherTile(props) {
  return(
    <div className="tile">
      <div className="weatherIco">
      <img src={props.icon} />
      </div>
        <p>{props.date}</p>
        <p>{props.high} / {props.low}</p>
    </div>
  )
}
export default WeatherTile;
